DROP SCHEMA IF EXISTS `iris` CASCADE;

CREATE SCHEMA `iris` CHARACTER SET 'utf8' COLLATE 'utf8_general_ci';


--                                                                             --
-- Category table                                                              --
--                                                                             --

DROP TABLE IF EXISTS `category` CASCADE;

CREATE TABLE `category` (
  `uid` TINYINT(1) UNSIGNED NOT NULL COMMENT 'Identifier of the category',
  `name` VARCHAR(31) COMMENT 'Name of the category',
  `note` VARCHAR(255) COMMENT 'Note about the category'
) ENGINE InnoDB COMMENT 'Categories of the unusable ICD-10 Code' CHARACTER SET 'utf8' COLLATE 'utf8_general_ci';



--                                                                             --
-- Level table                                                                 --
--                                                                             --

DROP TABLE IF EXISTS `level` CASCADE;

CREATE TABLE `level` (
  `uid` TINYINT(1) UNSIGNED NOT NULL COMMENT 'Identifier of the level',
  `name` VARCHAR(31) COMMENT 'Name of the level',
  `note` VARCHAR(255) COMMENT 'Note about the level'
) ENGINE InnoDB COMMENT 'Levels of the garbage code' CHARACTER SET 'utf8' COLLATE 'utf8_general_ci';



--                                                                             --
-- icd10codes table                                                            --
--                                                                             --

DROP TABLE IF EXISTS `icd10code` CASCADE;

CREATE TABLE `icd10code` (
  `code` VARCHAR(4) PRIMARY KEY NOT NULL COMMENT 'ICD-10 Code',
  `name` VARCHAR(255) NOT NULL COMMENT 'Name of the ICD-10 Code',
  `garbage` TINYINT(1) UNSIGNED NOT NULL COMMENT 'ICD-10 Code is a garbage code',
  `category` TINYINT(1) UNSIGNED NOT NULL COMMENT 'Category of the unusable ICD-10 Code',
  `level` TINYINT(1) UNSIGNED NOT NULL COMMENT 'Level of the garbage code',
  `note` VARCHAR(511) COMMENT 'Note about the ICD-10 Code'
) ENGINE InnoDB COMMENT 'ICD-10 Codes' CHARACTER SET 'utf8' COLLATE 'utf8_general_ci';

