INSERT INTO `icd10code` () VALUES ('Y830', 'Surgical operation with transplant of whole organ as the cause of abnormal reaction of the patient, or of later complication, without mention of misadventure at the time of the procedure', '0', '0', '0', 'Iris applied the ICD-10 rules and concluded that the root cause is Y83-Y84. It is important that the condition that motivated the surgery or procedure in question is recorded on the certificate, as this will be the basic cause of death. If the registration of the condition has been carried out, the certificate will be well filled, regardless of the underlying cause selected by the application.');
